import React, { Component } from "react";

import "./Header.css";

export default class Header extends Component {
  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col>
              <h1>(React) GOOGLE BOOKS</h1>
              <h2>Search and Save Books</h2>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}
